namespace OASv1.Model;public class AProductModel{    public Guid Id { get; init; }    public Double Valor { get; private set; }    public String NomeDoProduto { get; private set; }    public String ResponsavelPelaBuscaDoProduto { get; private set; }    public String NotaFiscal { get; private set; }    public DateTime Validade { get; private set; }    public DateTime DataDeRecebimento { get; private set; } = DateTime.Now;    public DateTime DataDeAlteracao { get; private set; } = DateTime.Now;    public AProductModel(Guid Id, Double Valor, DateTime Validade, DateTime DataDeRecebimento        , String NomeDoProduto, String ResponsavelPelaBuscaDoProduto, DateTime DataDeAlteracao, String NotaFiscal)    {        this.Id = Id;        this.Valor = Valor;        this.Validade = Validade;        this.DataDeRecebimento = DataDeRecebimento;        this.NomeDoProduto = NomeDoProduto;        this.ResponsavelPelaBuscaDoProduto = ResponsavelPelaBuscaDoProduto;        this.DataDeAlteracao = DataDeAlteracao;        this.NotaFiscal = NotaFiscal;    }}